import "antd/dist/antd.css";
import '../assets/css/Home.css'
import '../assets/css/modern-business.css'

//import SlideShow from 'react-image-show';
import CardTemp from "../components/CardTemp";
import Slid from "../components/Slid";
class Home extends Component {
    constructor(){
        super();
        state :
            {
                events: null;

            };
        const events=null;
        const backgroundimg ={'backgroundImage':'http://placehold.it/1900x1080'};


    }
    async componentDidMount(){
        /*const url = "http://localhost:8080/Accueil/events";
        const response = await fetch(url);
        const data = await response.json();
            */
        fetch("http://localhost:8080/Accueil/events").then(  results => results.json())
        .then(data => {this.events=  data.results.map((elt)=>{   
            return (<CardTemp key={elt.id} title={elt.title} descri={elt.description} />) })
    })
    this.setState({events:this.events});
    console.log(this.state);
    }
    render() { 
        return (
               < div>
                        <Slid/>
                        <div className="jumbotron">
                            <h1 className="display-3">Actualité et évènement</h1>
                            <p className="lead">This is a sntent or information.</p>
                            <hr/>
                            <p>It uses utility classNamees for typography and ent out within the larger container.</p>
                          
                            <div className="row">
                                <CardTemp descri="one"/>
                                <CardTemp num="two"/>
                                <CardTemp num="three"/>
                            </div>

                        </div>

                </div>
                 );
  }

}
export default Home;
